{"ipad": null, "android": null, "ios": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420", "app_name": "Flickr", "app_id": "328407587"}, "iphone": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420/", "app_name": "Flickr", "app_id": "328407587"}}, "site_name": "Flickr", "description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others.  \t \tI took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac.  \t \tBeyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. \t \tCurrently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. \t \tThe hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. \t \tAndreas Komodromos Photostream", "link_status": 0, "title": "Sunset at Chelsea Piers, New York City - Titanic's destination", "locale": "en", "amp_valid": false, "amp_url": "", "url": "https://www.flickr.com/photos/andreas_komodromos/33658664420", "type": "richpindataview", "tracker": null, "apple_touch_icon_link": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4", "favicon_images": {"orig": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "article": {"description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others. I took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac. Beyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. Currently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. The hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. Andreas Komodromos Photostream", "date_published": null, "authors": [], "type": "articlemetadata", "id": "140600840351056", "name": "Sunset at Chelsea Piers, New York City - Titanic's destination"}, "has_price_drop": false, "id": "24508159d539d372d8b113d49e668b07", "apple_touch_icon_images": {"orig": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4"}, "favicon_link": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "link": "https://www.flickr.com/photos/andreas_komodromos/33658664420", "has_required_attribution_provider": true, "pinner": {"username": "NYAndreas", "first_name": "Andreas", "last_name": "", "explicitly_followed_by_me": false, "full_name": "Andreas Komodromos", "image_small_url": "http "description_html": "Sunset, Chelsea Piers, NYC - Titanic&amp;#39;s destination | by NYAndreas", "title": "", "comment_count": 0, "board": {"is_collaborative": false, "name": "New York City Photography", "url": "/NYAndreas/new-york-city-photography/", "owner": {"id": "199284489669577471"}, "type": "board", "id": "199284420950358977"}, "type": "pin", "story_pin_data_id": null, "attribution": null, "description": "Sunset, Chelsea Piers, NYC - Titanic's destination | by NYAndreas", "shopping_flags": [], "rich_metadata": {"aggregated_app_link": {"ipad": null, "android": null, "ios": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420", "app_name": "Flickr", "app_id": "328407587"}, "iphone": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420/", "app_name": "Flickr", "app_id": "328407587"}}, "site_name": "Flickr", "description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others.  \t \tI took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac.  \t \tBeyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. \t \tCurrently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. \t \tThe hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. \t \tAndreas Komodromos P 9595ffa7c7d7d1a433"}}}, {"domain": "flickr.com", "tracking_params": "CwABAAAADDkyNzcwMDUwMjA2NgA", "aggregated_pin_data": {"aggregated_stats": {"saves": 1, "done": 0}}, "image_signature": "3d226a685f565c2392fef4728b7828b2", "like_count": 0, "images": {"170x": {"url": "https://i.pinimg.com/170x/3d/22/6a/3d226a685f565c2392fef4728b7828b2--a-gym-skating-rink.jpg", "width": 170, "height": 127}, "474x": {"url": "https://i.pinimg.com/474x/3d/22/6a/3d226a685f565c2392fef4728b7828b2--a-gym-skating-rink.jpg", "width": 474, "height": 355}, "orig": {"url": "https://i.pinimg.com/originals/3d/22/6a/3d226a685f565c2392fef4728b7828b2.jpg", "width": 1024, "height": 768}, "236x": {"url": "https://i.pinimg.com/236x/3d/22/6a/3d226a685f565c2392fef4728b7828b2--a-gym-skating-rink.jpg", "width": 236, "height": 177}}, "id": "199284352243130348", "description_html": "The Chelsea Piers Sports &amp;amp;amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others, was originally a passenger ship terminal that was built in the early 1900s and was intended to serve as the destination for the RMS Titanic.", "title": "", "comment_count": 0, "board": {"is_collaborative": false, "name": "New York City Photography", "url": "/NYAndreas/new-york-city-photography/", "owner": {"id": "199284489669577471"}, "type": "board", "id": "199284420950358977"}, "type": "pin", "story_pin_data_id": null, "attribution": null, "description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others, was originally a passenger ship terminal that was built in the early 1900s and was intended to serve as the destination for the RMS Titanic.", "shopping_flags": [], "rich_metadata": {"aggregated_app_link": {"ipad": null, "android": null, "ios": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420", "app_name": "Flickr", "app_id": "328407587"}, "iphone": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420/", "app_name": "Flickr", "app_id": "328407587"}}, "site_name": "Flickr", "description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others.  \t \tI took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac.  \t \tBeyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. \t \tCurrently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. \t \tThe hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. \t \tAndreas Komodromos Photostream", "link_status": 0, "title": "Sunset at Chelsea Piers, New York City - Titanic's destination", "locale": "en", "amp_valid": false, "amp_url": "", "url": "https://www.flickr.com/photos/andreas_komodromos/33658664420/", "type": "richpindataview", "tracker": null, "apple_touch_icon_link": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4", "favicon_images": {"orig": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "article": {"description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others. I took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac. Beyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. Currently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. The hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. Andreas Komodromos Photostream", "date_published": null, "authors": [], "type": "articlemetadata", "id": "140600840351248", "name": "Sunset at Chelsea Piers, New York City - Titanic's destination"}, "has_price_drop": false, "id": "3566cf726f0b646c7f668184cd0dafd9", "apple_touch_icon_images": {"orig": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4"}, "favicon_link": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "link": "https://www.flickr.com/photos/andreas_komodromos/33658664420/", "has_required_attribution_provider": true, "pinner": {"username": "NYAndreas", "first_name": "Andreas", "last_name": "", "explicitly_followed_by_me": false, "full_name": "Andreas Komodromos", "image_small_url": "https://i.pinimg.com/30x30_RS/00/1d/dd/001ddd148688ea5bb62b8eb2dcb6d544.jpg", "type": "user", "id": "199284489669577471", "image_large_url": "https://i.pinimg.com/140x140_RS/00/1d/dd/001ddd148688ea5bb62b8eb2dcb6d544.jpg"}, "repin_co 328407587"}, "iphone": {"app_url": "flickr://flickr.com/photos/andreas_komodromos/33658664420/", "app_name": "Flickr", "app_id": "328407587"}}, "site_name": "Flickr", "description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others.  \t \tI took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac.  \t \tBeyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. \t \tCurrently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. \t \tThe hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. \t \tAndreas Komodromos Photostream", "link_status": 0, "title": "Sunset at Chelsea Piers, New York City - Titanic's destination", "locale": "en", "amp_valid": false, "amp_url": "", "url": "https://www.flickr.com/photos/andreas_komodromos/33658664420", "type": "richpindataview", "tracker": null, "apple_touch_icon_link": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4", "favicon_images": {"orig": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "article": {"description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others. I took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac. Beyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. Currently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. The hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. Andreas Komodromos Photostream", "date_published": null, "authors": [], "type": "articlemetadata", "id": "140600840351056", "name": "Sunset at Chelsea Piers, New York City - Titanic's destination"}, "has_price_drop": false, "id": "24508159d539d372d8b113d49e668b07", "apple_touch_icon_images": {"orig": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4"}, "favicon_link": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "link": "https://www.flickr.com/photos/andreas_komodromos/33658664420", "has_required_attribution_provider": true, "pinner": {"username": "NYAndreas", "first_name": "Andreas", "last_name": "", "explicitly_followed_by_me": false, "full_name": "Andreas Komodromos", "image_small_url": "https://i.pinimg.com/30x30_RS/00/1d/dd/001ddd148688ea5bb62b8eb2dcb6d544.jpg", "type": "user", "id": "199284489669577471", "image_large_url": "https:/ mplex, now the home of a gym, a skating rink and TV studios among others.  \t \tI took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac.  \t \tBeyond that, this location's original purpose is rather historic and certainly worthy of mentioning, so if interested please keep reading. \t \tCurrently re-imagined as a sports complex - Pier 60 on the left is a gym and Pier 61 on the right is an ice skating rink, while Pier 59 (not shown here) is a golf course - these Piers were originally passenger ship terminals that were built in the early 1900s. The spot seen here was intended to serve as the destination for the RMS Titanic, which sunk in 1912 on its maiden trip on the way here. \t \tThe hallway connecting these two Piers is filled with historic documents, including some goosebump-inducing photos showing the arrival of the RMS Carpathia (the only ship that responded to the Titanic's S.O.S.), carrying the few survivors from that infamous maritime disaster. \t \tAndreas Komodromos Photostream", "link_status": 0, "title": "Sunset at Chelsea Piers, New York City - Titanic's destination", "locale": "en", "amp_valid": false, "amp_url": "", "url": "https://www.flickr.com/photos/andreas_komodromos/33658664420/", "type": "richpindataview", "tracker": null, "apple_touch_icon_link": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4", "favicon_images": {"orig": "https://i.pinimg.com/favicons/f1def2d953077deabc5605a6c5f00f6f361a2c491b0ec4bd08f77659.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "article": {"description": "The Chelsea Piers Sports &amp; Entertainment Complex, now the home of a gym, a skating rink and TV studios among others. I took this photo on my way to the gym at Chelsea Piers in New York City, using my iPhone 6 Plus with all editing done using Photos on an iMac. Beyond that, this location's original purpose is
